  true,\n\t\"url\": null,\n\t\"notes\": \"This proposal is for a flexible navigation
  system for deep space operations that does not require rnGPS measurements. The navigation
  solution is computed using an Unscented Kalman Filter that rncan accept any combination
  of range, planet chordwidth, and angle measurements using any ce- rnlestial object.
  The UKF employs a full nonlinear dynamical model of the orbit including gravity
  models and disturbance models. The filter will estimate both states and parameters.
  The integrated system employs a sensor that uses novel image processing to extract
  planetary chordwidths. The extra-solar system body sensor will employ band limiting
  imaging with the band selected to maximize reliable autonomous object identification.
